import {BsFillCartFill} from "react-icons/fa"

const Navbar = () => {
  return (
    <div>
       <div className="flex flex-row justify-between">
             <img src=""/>
             <div>
              <p>Home</p>
              <BsFillCartFill/>
             </div>
       </div>
    </div>
  )
};

export default Navbar;
